import React, { Component } from 'react'
import Box from './Box'
import List from './List'

export default class Facade extends Component {
    constructor(props) {
        super()
        this.state = {
            item: [],
            currenItem: {
                text: '',
                key: ''
            }
        }
    }
    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <p>Todo App</p>
                    <Box/>
                    <List/>
                </header>
            </div>
        )
    }
}
